import React from 'react';


const Navbar = () => {
    return (
        <nav className="navbar">
            <a href="/"> <h1>Memory Glass</h1> </a>
            <div className="links">
                <a href="/">Home </a>
                <a href="/about us">About us</a>
                <a href="/create" style= {{
                    color: "white",
                    borderRadius: "7px",
                    backgroundColor: '#6abaf3'
                }}>Login</a>

            </div>
        </nav>
    );
}

export default Navbar;
